To create a Chrome extension that takes screenshots of the current tab, you'll need to create a manifest file, a background script, and a popup HTML file. Here's a step-by-step guide:

1. Create a new directory for your extension and navigate to it.

2. Create a file named `manifest.json` with the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab",
  "permissions": ["activeTab"],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_popup": "popup.html"
  }
}
```

3. Create a file named `background.js` with the following content:

```javascript
chrome.browserAction.onClicked.addListener(function(tab) {
  chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
    var a = document.createElement("a");
    a.href = dataUrl;
    a.download = "screenshot.png";
    a.click();
  });
});
```

4. Create a file named `popup.html` with the following content:

```html
<!DOCTYPE html>
<html>
<head>
  <title>Screenshot Extension</title>
</head>
<body>
  <button id="capture-button">Capture Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

5. Create a file named `popup.js` with the following content:

```javascript
document.getElementById("capture-button").addEventListener("click", function() {
  chrome.tabs.captureVisibleTab(null, {format: "png"}, function(dataUrl) {
    var a = document.createElement("a");
    a.href = dataUrl;
    a.download = "screenshot.png";
    a.click();
  });
});
```

6. Load the extension in Chrome:
   - Open the Chrome browser and go to `chrome://extensions`.
   - Enable "Developer mode" using the toggle switch in the top right corner.
   - Click on "Load unpacked" and select the directory containing your extension files.

7. The extension should now be loaded and visible in the Chrome toolbar.

When you click on the extension icon, it will open the popup. Clicking the "Capture Screenshot" button in the popup will take a screenshot of the current tab and download it as "screenshot.png".

The `background.js` script listens for the `onClicked` event of the browser action and captures the visible tab using `chrome.tabs.captureVisibleTab()`. The `popup.js` script handles the click event of the "Capture Screenshot" button in the popup and performs the same action.

